■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>年末年始、続く疲れに!クルクミノイド57mg配合!</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5426/1071346-01.jpg" width="600" height="600"><br><font size=3></font></div><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"><tr><td width="600" valign="top"><div align="center"><img width="600" height="828" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5426/1071346-02.jpg"><br><font size="3"></font></div><br></td></tr><tr><td width="600" valign="top"><div align="center"><img width="600" height="416" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5426/1071346-03.jpg"><br><font size="3"></font></div><br></td></tr><tr><td width="600" valign="top"><div align="center"><img width="600" height="450" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5426/1071346-04.jpg"><br><font size="3"></font></div><br></td></tr></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">ウコン、オルニチン、シトルリンを配合した、お酒好きの方のためのサプリメント。年末年始など、飲み会の多くなる時期に後悔しない明日を迎えるため、ウコン習慣始めましょう!</font></td></tr></table><br><!--栄養成分・原材料表ここから--><table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">栄養成分</font></td><td width="75%"><font color="#333333" size="-1">【1粒450mg(内容量380mg)当たり】<br>エネルギー:1.81kcal、たんぱく質:0.41g、脂質:0.01g、炭水化物:0.01g、ナトリウム:0.14mg</font></td></tr><tr bgcolor="#FFFFFF"><td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">原材料</font></td><td width="75%"><font color="#333333" size="-1">名称：ウコン、アミノ酸加工食品<br>L-オルニチン硫酸塩、L-シトルリン、ウコン抽出物(クルクミノイド含有)、デキストリン、HPMC(被包材)、ステアリン酸カルシウム、微硫酸化ケイ素</font></td></tr></table><br><!--栄養成分・原材料表ここまで--><!--その他アレルギーここから--><!--保存方法と製造（販売）者情報ここから--><table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">保存方法</font></td><td width="75%"><font color="#333333" size="-1">高温多湿および直射日光を避け、涼しい所に保存してください。</font></td></tr><tr bgcolor="#FFFFFF"><td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">製造（販売）者情報</font></td><td width="75%"><font color="#333333" size="-1">製造販売者:株式会社エーエフシー<br>静岡県静岡市駿河区豊田2丁目4番3号</font></td></tr></table><br><!--保存方法と製造（販売）者情報ここまで--><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">ウコン、オルニチン、シトルリンを配合した、お酒好きの方のためのサプリメント。年末年始など、飲み会の多くなる時期に後悔しない明日を迎えるため、ウコン習慣始めましょう!</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">商品区分</font></td><td width="75%" align="left"><font color="#333333" size="-1">健康食品</font></td></tr><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td><td width="75%" align="left"><font color="#333333" size="-1">40.5g(450mg(内容量380mg)×90カプセル)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">個装サイズ：5×5×6cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：80g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">賞味期間：製造日より720日</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
