■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<p><table width="600" border="0" align="center" cellpadding="0" cellspacing="0">  <tr>  <td>  <font color="#009999" size="5"><strong>1袋にしじみ約116個分のエキス配合!</strong></font>  </td>  </tr>  </table><br>  <table width="610" border="0" align="center" cellpadding="1" cellspacing="0">   <tr>   <td width="610" valign="top" align="center"><div >  <img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0343/9811an-01.jpg" width="600" height="800"></div><br>  <table width="600" border="0" align="center" cellpadding="1" cellspacing="0">   <tr>   <td width="600" valign="top" align="left">  <font size="3">【お召し上がり方】<br>  1日に5粒を目安に、水またはぬるま湯でお召し上がり下さい。<br>  <br>  【保存方法】<br>  高温多湿や直射日光を避けて涼しいところに保存してください。<br>  <br>【製造(販売)者】<br>株式会社ファイン<br>大阪市東淀川区下新庄5丁目7番8号</font>  </td>  </tr>  </table>  <br><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0">   <tr>   <td width="600" valign="top" align="left">  <br>  <font size="3">本品は国産の健康な豚レバーを使用した肝臓水解物をはじめ、国産のしじみエキス、クルクミン、亜鉛やオルニチンを配合しています。ご家族皆様の毎日の健康にお勧めします。</font>  </td>  </tr>  </table>  </td>  </tr>  </table>  <br>  <!--栄養成分・原材料表ここから-->  <table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF">  <td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">栄養成分</font></td>  <td width="75%"><font color="#333333" size="-1">栄養成分/3～6粒あたり:エネルギー11～22kcal、たんぱく質0.65～1.3g、脂質0.83～1.66g、炭水化物0.26～0.52g、ナトリウム15～30mg、ビタミン(B1)1～2mg、ビタミン(B2)1.1～2.2mg、ビタミン(B6)1～2mg、亜鉛7～14mg、規格成分/3～6粒あたり:肝臓水解物300～600mg、しじみエキス末50～100mg、クルクミン30～60mg、オルニチン13～26mg</font></td>  </tr><tr bgcolor="#FFFFFF">  <td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">原材料</font></td>  <td width="75%"><font color="#333333" size="-1">サフラワー油、ゼラチン、肝臓水解物、亜鉛酵母、しじみエキス、ウコン抽出物、オルニチン、ウコン末、グリセリン、光沢剤(ミツロウ)、乳化剤(グリセリン脂肪酸エステル)、カラメル色素、酸化防止剤(ビタミンE)、ビタミンB6、ビタミンB1、ビタミンB2(原材料の一部に大豆を含む)</font></td>  </tr></table>  <br>  <!--栄養成分・原材料表ここまで--></p><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">本品は国産の健康な豚レバーを使用した肝臓水解物をはじめ、国産のしじみエキス、クルクミン、亜鉛やオルニチンを配合しています。ご家族皆様の毎日の健康にお勧めします。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td><td width="75%" align="left"><font color="#333333" size="-1">56.7g(630mg×90粒)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">個装サイズ：12×19×2cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：63g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">ソフトカプセル</font><br><font color="#333333" size="-1">商品区分：栄養機能食品(ビタミンB1)</font><br> <font color="#333333" size="-1">賞味期間：製造日より24ヶ月</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
