■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<p><table width="600" border="0" align="center" cellpadding="0" cellspacing="0">  <tr>  <td>  <font color="#009999" size="5"><strong>クルクミノイドの含有量が95％の高濃度のウコンエキスを使用。</strong></font>  </td>  </tr>  </table><br>  <table width="610" border="0" align="center" cellpadding="1" cellspacing="0">   <tr>   <td width="610" valign="top" align="center"><div >  <img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0305/2235al-01.jpg" width="300" height="519"></div><br>  <table width="600" border="0" align="center" cellpadding="1" cellspacing="0">   <tr>   <td width="600" valign="top" align="left"><font size="3">販売者:補完医療製薬株式会社<br>大阪市中央区谷町9-2-27-303Ａ<br><br></p><p>?</p><p>●お徳用サイズの180日分です。<br>  <br>  ・食品として、1日に2～3粒程度を目安に水などでお召し上がりください。<br>  ・開封後はなるべく早くお召し上がりください。<br>  ・万一体質に合わない場合はご利用を中止してください。<br>  ・天然由来の成分を主として使用しているため、多少色のバラツキが生じる場合がございますが、品質には全く問題はありません。<br>  ・冷暗所で保管してください。</font>  </td>  </tr>  </table>  <br><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0">   <tr>   <td width="600" valign="top" align="left">  <br>  <font size="3">ウコンのパワーの秘密はクルクミノイドというウコン特有の成分の為と言われています。「濃縮パワーウコン」はクルクミノイドの含有量が95％の高濃度のウコンエキスを主原料にウコン末をプラスしました。</font>  </td>  </tr>  </table>  </td>  </tr>  </table>  <br>  <!--栄養成分・原材料表ここから-->  <table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF">  <td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">栄養成分</font></td>  <td width="75%"><font color="#333333" size="-1">(2粒600mgあたり)エネルギー2.39kcal、たんぱく質0.02g、脂質0.04g、炭水化物0.49g、ナトリウム0.08mg、【主要成分および配合量】(2粒600mgあたり)秋ウコンエキス末150mg、秋ウコン末150mg</font></td>  </tr><tr bgcolor="#FFFFFF">  <td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">原材料</font></td>  <td width="75%"><font color="#333333" size="-1">麦芽糖、ウコンエキス末、ウコン末、結晶セルロース、ショ糖脂肪酸エステル、ステアリン酸Ca、微粒二酸化ケイ素、コーンスターチ、ヒドロキシプロピルセルロース　</font></td>  </tr></table>  <br>  <!--栄養成分・原材料表ここまで-->        </p><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">ウコンのパワーの秘密はクルクミノイドというウコン特有の成分の為と言われています。「濃縮パワーウコン」はクルクミノイドの含有量が95％の高濃度のウコンエキスを主原料にウコン末をプラスしました。</font></td></tr></table><br><p><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666">  <tr bgcolor="#FFFFFF">  <td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td>  <td width="75%" align="left"><font color="#333333" size="-1">108g(300mg×360粒)</font></td>  </tr>  <tr bgcolor="#FFFFFF">  <td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td>  <td align="left"><font color="#333333" size="-1">巾70×奥行70×高さ132mm</font><br><font color="#333333" size="-1">個装サイズ：7×7×13.5cm</font>  </td>  </tr>  <tr bgcolor="#FFFFFF">  <td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td>  <td align="left"><font color="#333333" size="-1">380g</font><br><font color="#333333" size="-1">個装重量：380g</font></td>  </tr>  <tr bgcolor="#FFFFFF">  <td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td>  <td align="left"><font color="#333333" size="-1">外箱・ラベル:紙、キャップ・緩衝フィルム:プラ、ビンボトル</font></td>  </tr>  <tr bgcolor="#FFFFFF">  <td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td>  <td align="left">  <font color="#333333" size="-1">区分：健康食品</font><br>  <font color="#333333" size="-1">名称：秋ウコン含有食品</font><br>  <font color="#333333" size="-1">賞味期限:製造日より720日</font><br></p><p></td>  </tr>  <tr bgcolor="#FFFFFF">  <td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td>  <td align="left"><font color="#333333" size="-1">日本</font></td>  </tr>  </table></p><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
